INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('NexGard Antipulgas e Carrapatos para Cães', 232.90, 'Para garantir o bem-estar e manter os pets protegidos, sempre escolhemos o que há de melhor, concorda? Contra a ação de pulgas e carrapatos, conheça o Nexgard 25 a 50kg, medicamento desenvolvido pela Merial para o combate eficaz destes parasitas. Disponível em comprimidos mastigáveis, que facilitam a administração, ele é uma excelente solução. Entretanto, sempre há dúvida sobre isso, e para te ajudar, reunimos os principais questionamentos e utilizamos a própria bula do Nexgard 25 a 50kg para responder.', 0, 1, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Antipulgas Advocate para Gatos de até 4 Kg', 159.72, 'O Antipulgas Bayer Advocate para Gatos até 4 Kg - 0,4 mL é indicado para a prevenção e tratamento das infestações por pulgas, sarcóptica e demodécica e os vermes intestinais em gatos até 4 kg de peso.', 1, 1, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração Seca Hill´s Science Diet Filhotes e Mini', 179.99, 'Hills Science Diet Canino Filhote Pequenos e Mini é um alimento feito com ingredientes selecionados para atender as necessidades dos filhotes. Suporte ao desenvolvimento corporal ideal, auxiliando na manutenção de ossos e músculos fortes. Benefícios comprovados dos antioxidantes. Proteínas de alta qualidade para uma condição corpórea ideal. Sem corantes e saborizantes artificiais. Fibras de alta qualidade, ácidos graxos e antioxidantes que ajudam a manter a pele, pelagem e digestão saudáveis.', 0, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração Hills Cães Adultos Raças Grandes 12 kg', 539.99, 'Feita com ingredientes de alta qualidade, a Ração Hills Science Diet contém em sua composição proteínas que promovem ótima condição corpórea, sem corantes e saborizantes artificiais. Com um complexo com vitaminas C e E que são antioxidantes comprovados, mantendo seu cão saudável e em ótima forma física.', 0, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Milbemax G 4/10 Elanco para Gatos 2 KG', 25.42, 'O Milbemax para gatos com peso entre 0,5 e 2kg é indicado para tratamento de animais filhotes com infecção intestinal por vermes. Além disso, o medicamento também atua na prevenção de doenças como a dirofilariose, infecção pelo verme do coração. Com Milbemax, o seu pet está sempre seguro.', 1, 1, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração GranPlus Gourmet Cães Adultos 3kg', 69.90, 'A ração GranPlus Gourmet para cães adultos de porte médio e grande é ideal para o tutor preocupado em oferecer uma alimentação saudável ao pet. Com sabor de ovelha e arroz, a ração se destaca por não ter ingredientes transgênicos, corantes e aromas artificiais em sua fórmula.', 0, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração GranPlus Menu Cães Adulto', 69.99, 'A GranPlus é uma ração High Premium, sem conrantes e aromas artificiais ideal para mante a longevidade e a saúde do seu cãozinho', 0, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração Golden Gatos Filhotes Sabor Frango', 28.50, 'Gatos filhotes precisam de cuidados especiais e uma alimentação que atenda às suas necessidades, para um crescimento e desenvolvimento saudável. Então, para garantir uma boa nutrição na infância, que vai resultar num adulto saudável, a Ração Golden Gatos Filhotes Sabor Frango é a melhor escolha.', 1, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('PremieRpet gatos filhotes sabor frango', 78, 'Seu filhote atravessa uma das fases mais importantes da vida, quando os cuidados oferecidos são decisivos para garantir um crescimento adequado e cheio de saúde. PremieR Gatos Filhotes é elaborado com as fontes mais nobres de proteínas, fibras e gorduras, por isso, o desenvolvimento do seu pequeno felino será o melhor possível. Para sua saúde intestinal, ainda delicada, o alimento é enriquecido com prebióticos que ajudam na formação da flora benéfica. Além disso, PremieR Gatos Filhotes proporciona uma pelagem muito mais bonita e macia, ideal para receber seu carinho.', 1, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração Seca Origens Salmão Gatos Castrados', 174.90, 'Origens é uma linha de alimentos Premium Especial que nutre o que há de melhor: o amor. Promover saúde e prazer a cada refeição é antes de tudo um ato de carinho, que estreita laços e prolonga os dias de alegria, amizade e amor incondicional entre tutores e seus cães e gatos. Origens Gatos Castrados Sabor Salmão possui ingredientes de alta qualidade e não contém corantes e aromatizantes artificiais. Indicado para gatos castrados, sedentários, com tendência a engordar e para quem tem mais de um gato em casa.', 1, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Ração Whiskas Carne Gatos Adultos Castrados', 235.90, 'LEVE 10,1 KG PAGUE 9 KG Ração Premium 100% completa e balanceada. Sem corantes presentes na ração para gatos castrados. Nuggets crocantes com recheio macio e saboroso. Com prebióticos que contribuem para digestão saudável. Desenvolvida nutricionalmente em conjunto com veterinários. Ajuda na manutenção do peso ideal de gatos castrados. Controle de minerais para manter o trato urinário saudável. Com fibras naturais que ajudam a eliminação de bolas de pelo.', 1, 2, '');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Brinquedo Arranhador Casa para Gatos', 499.90, 'Arranhador Para Gato Casa Com Rede Os arranhadores para gatos são um brinquedo necessário e fundamental para qualquer felino. Os felinos precisam de afiar as suas unhas, arranhar e ter um lugar que seja deles, por isso se não quer começar a ver os seus móveis a estragarem-se, o arranhador é a solução. Além disso, o processo de arranhar é muito importante para o seu pet, pois também faz parte dos seus processos de limpeza, higiene, brincadeira e liberação emocional. Arranhador de madeira mdf, cano revestido com sisal, tecido pelúcia.', 1, 3,'');
INSERT INTO tb_produto (nome, preco, descricao, tipo, categoria_id, img) VALUES ('Kit Mordedor Pet 2 Brinquedos Para Cães', 32.90, 'O seu animal vai se divertir muito com o kit de brinquedos divertidos! É um brinquedo que além de apresentar formato criativo e divertido, faz som quando seu animal morder, deixando a brincadeira ainda mais engraçada.', 0, 3, '');
